      axios.get("https://api.openweathermap.org/data/2.5/forecast?q=seattle&appid=1fe1feaae7c13da06123fde728b01b3d").then((response) => {
        setUsers(response.data.data);
      });
    }, []);



    return(

        <div className="header">
            <SearchBar />
